def read_board(state, difficulty, player_number):
    if player_number == 1 or player_number.lower() == "player 1":
        if difficulty.lower() == "easy":
            StateTable = Difficulty.p1_easy
        elif difficulty.lower() == "medium":
            StateTable = Difficulty.p1_medium
        elif difficulty.lower() == "hard":
            StateTable = Difficulty.p1_hard
        elif difficulty.lower() == "impossible":
            StateTable = Difficulty.p1_impossible
        else:
            raise DifficultyError
    elif player_number == 2 or player_number.lower() == "player 2":
        if difficulty.lower() == "easy":
            StateTable = Difficulty.p2_easy
        elif difficulty.lower() == "medium":
            StateTable = Difficulty.p2_medium
        elif difficulty.lower() == "hard":
            StateTable = Difficulty.p2_hard
        elif difficulty.lower() == "impossible":
            StateTable = Difficulty.p2_impossible
        else:
            raise DifficultyError
    else:
        raise PlayerNumberError

    state1 = f'{state[0]}{state[1]}{state[2]}{state[3]}{state[4]}{state[5]}{state[6]}{state[7]}{state[8]}'
    state2 = f'{state[2]}{state[5]}{state[8]}{state[1]}{state[4]}{state[7]}{state[0]}{state[3]}{state[6]}'
    state3 = f'{state[8]}{state[7]}{state[6]}{state[5]}{state[4]}{state[3]}{state[2]}{state[1]}{state[0]}'
    state4 = f'{state[6]}{state[3]}{state[0]}{state[7]}{state[4]}{state[1]}{state[8]}{state[5]}{state[2]}'

    if state1 in StateTable:
        templist = ['_', '_', '_', '_', '_', '_', '_', '_', '_']
        r = secrets.SystemRandom()
        choice = r.choices(StateTable[state1][0], StateTable[state1][1])
        templist[choice[0]] = "X"
        return choice[0]
    elif state2 in StateTable:
        templist = ['_', '_', '_', '_', '_', '_', '_', '_', '_']
        r = secrets.SystemRandom()
        choice = r.choices(StateTable[state2][0], StateTable[state2][1])
        templist[choice[0]] = "X"
        templist = [templist[6], templist[3], templist[0], templist[7], templist[4], templist[1], templist[8],
                    templist[5], templist[2]]
        choice = templist.index("X")
        return choice
    elif state3 in StateTable:
        templist = ['_', '_', '_', '_', '_', '_', '_', '_', '_']
        r = secrets.SystemRandom()
        choice = r.choices(StateTable[state3][0], StateTable[state3][1])
        templist[choice[0]] = "X"
        templist = [templist[8], templist[7], templist[6], templist[5], templist[4], templist[3], templist[2],
                    templist[1], templist[0]]
        choice = templist.index("X")
        return choice
    elif state4 in StateTable:
        templist = ['_', '_', '_', '_', '_', '_', '_', '_', '_']
        r = secrets.SystemRandom()
        choice = r.choices(StateTable[state4][0], StateTable[state4][1])
        templist[choice[0]] = "X"
        templist = [templist[2], templist[5], templist[8], templist[1], templist[4], templist[7], templist[0],
                    templist[3], templist[6]]
        choice = templist.index("X")
        return choice
    else:
        print("BOARD ERROR")
        raise SystemError
